let initialState = {
    getUsersList: false,
    errorUsersList: false,
    tittle: "Profil Robot"
};

const users = (state = initialState, action) => {
    switch (action.type) {
        case 'HALLO':
            return state + 1;
        case 'ARRAY':
            return state;
            default:
            return state;
    }
}

export default users
